import React  from "react";
class CountryClass extends React.Component{
    render(props){
        const { name, region, currency, president, image } = props.infos;

        return(
            <div>
            <h1>Country Information</h1>
            <p>name: {name}</p>
            <p>region: {region}</p>
            <p>currency: {currency}</p>
            <p>president: {president}</p>
            <p>image: {image}</p>
          </div> 


        )}
}
export default CountryClass
